import React, { useState } from 'react';

function AddShoplisting() {
  // State to manage form inputs
  const [shopName, setShopName] = useState('');
  const [shopLocation, setShopLocation] = useState('');
  const [shopDescription, setShopDescription] = useState('');

  // Function to handle form submission
  const handleSubmit = (event) => {
    event.preventDefault();
    
    // Normally, you would send the data to a server here
    console.log('Shop Name:', shopName);
    console.log('Shop Location:', shopLocation);
    console.log('Shop Description:', shopDescription);
    
    // Clear form fields
    setShopName('');
    setShopLocation('');
    setShopDescription('');
  };

  return (
    <div className="add-shop-listing">
      <h1>Add New Shop Listing</h1>
      <form onSubmit={handleSubmit} className="shop-form">
        <div className="form-group">
          <label htmlFor="shopName">Shop Name:</label>
          <input
            type="text"
            id="shopName"
            value={shopName}
            onChange={(e) => setShopName(e.target.value)}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="shopLocation">Location:</label>
          <input
            type="text"
            id="shopLocation"
            value={shopLocation}
            onChange={(e) => setShopLocation(e.target.value)}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="shopDescription">Description:</label>
          <textarea
            id="shopDescription"
            value={shopDescription}
            onChange={(e) => setShopDescription(e.target.value)}
            required
          ></textarea>
        </div>
        <button type="submit">Add Shop</button>
      </form>
    </div>
  );
}

export default AddShoplisting;
